import pandas as pd
import re
import matplotlib.pyplot as plt
import numpy as np
from tkinter import Tk 
from tkinter.filedialog import askopenfilename,askdirectory,asksaveasfilename
import os
import time
from IPython.display import display, Image
from IPython import display
from PIL import Image
from base64 import b64decode
import sys


# # Embedding images

# In[ ]:


documentation = ''
plot_print = ''
plot_save = ''
psi_duck = ''


# # Documentation

# In[ ]:


def show_documentation():    
    return display.Image(b64decode(documentation))


# # Functions for printing

# In[ ]:


def print_export():
    return display.Image(b64decode(plot_save))
def print_select_file():
    return display.Image(b64decode(plot_print))
def print_duck():
    return display.Image(b64decode(psi_duck))


# In[ ]:


def export_file():
    
    display.display(print_export())
    
    time.sleep(3) 
    
    Tk().withdraw()
    dir_name = askdirectory()
    path = os.path.join(dir_name,'RHOLINE_' + time.strftime("%Y-%m-%d_%H%M%S") + '.jpg')
    plt.savefig(path, bbox_inches = 'tight',dpi=600)
    print('\nThe image has been saved in the ' + dir_name + ' folder')


# In[2]:


def plotrholine():
    
    display.display(print_select_file())
    
    Tk().withdraw()
    filename = askopenfilename() 
    
    if filename.endswith('.RHOLINE'):
        pass
    else:
        display.display(print_duck())
        sys.exit('please, choose a valid file or rename it properly')

    l_dens=[]
    with open(filename, 'r') as f_dens:
        for i in f_dens:
            l_dens.append(i)

    m_dens=[]
    for i in l_dens:
        m_dens.append(re.sub("\s\s+" , " ", i))


    n_dens=[]
    for i in m_dens:
        n_dens.append(i.replace('\n','').split())


    df_dens=pd.DataFrame(n_dens)
    df_dens=df_dens.dropna()

    for i in range(0,len(df_dens.columns)):
        df_dens[i] = pd.to_numeric(df_dens[i])



    plt.plot((df_dens[0]-5.55)*0.529177249,df_dens[1]/0.148184743,color='cornflowerblue')

    #plt.xlim(0,4)
    #plt.ylim(0,50)

    plt.xlabel('d  [$\AA$]',fontsize=14)
    plt.ylabel(r'$\rho$  [$\frac{e}{\AA^3}$]',fontsize=16)

    export_file()

    plt.show()


